{"17": ["Товар пришел без шланга. Позор тому кто его взял. Взяла и.к завтра рано утром уезжаем. Сколов нет. Царапины на краске. Товар на троичку. Я растроена, т.к брала по отзывам.", "2020-08-19T10:08:22Z", "", "0", 2, 0, 3, "Канистра 10л горизонтальная металлическая", "STVOL"], "19": ["Товар пришёл без шланга. Возврат товара. К сожалению не почитала отзывы,иначе присмотрела бы другой. Жалко времени.", "2020-08-20T17:00:52Z", "", "0", 2, 0, 1, "Канистра 10л горизонтальная металлическая", "STVOL"], "20": ["Мне повезло. Канистра без вмятин, с заливным шлангом. Отличная вещь.", "2020-07-30T17:26:11.128818851Z", "colorless", "0", 1, 2, 5, "Канистра 10л горизонтальная металлическая", "STVOL"], "21": ["Канистра пришла с мятиной, упакована в один плиэтилен. Если бы была завёрнута хотя бы в бумагу и заклеена скотчем, мятины от ударов можно было избежать! Очень обидно получать за свои деньги повреждённый товар. Можно попытаться замазать и закрасить мятину, при этом возникают новые расходы и хлопоты... Очень жаль, что в компании до сих пор работают недобросовестные  сотрудники!", "2020-07-13T10:43:09.474872063Z", "colorless", "0", 20, 0, 2, "Канистра 10л горизонтальная металлическая", "STVOL"], "23": ["Очень жаль, но канистра, как и многим, пришла без шланга. А мне она так была нужна. Жаль, что отправитель не реагирует на комментарии покупателей. Разочарован. Возврат.", "2020-07-01T17:32:51.66552615Z", "colorless", "0", 7, 0, 1, "Канистра 10л горизонтальная металлическая", "STVOL"], "24": ["Получила вчера канистру.Как ни странно по отзывам ниже про шланг он есть!!! НО смотрите фото в каком состоянии пришла канистра :вмятины ,краска треснула под ней ржавчина и.тд.Сама канистра неплохая ,компактная .Если бы не вмятины взяла.Прошу не учитывать процент с выкупа!", "2020-06-23T16:34:03.370512089Z", "colorless", "0", 1, 0, 3, "Канистра 10л горизонтальная металлическая", "STVOL"], "25": ["Сколько уже жалоб, что нет шланга и ничего не делается. Может производитель глянет хоть раз на отзывых покупателей?", "2020-06-22T14:10:27.363986952Z", "colorless", "0", 3, 0, 2, "Канистра 10л горизонтальная металлическая", "STVOL"], "26": ["Получен товар, как видно на фото упаковка, обычный пакет и было упомянут в ранних коментах отсутствует гибкий шланг для перелива. Качество нормальное, крышка держится в норме.", "2020-06-11T08:03:22.877623382Z", "colorless", "0", 2, 0, 4, "Канистра 10л горизонтальная металлическая", "STVOL"], "27": ["Канистра поступила некомплект. Нет шланга в комплекте. Товар не выкупил. Вайлдберриз прошу не учитывать невыкуп товара, явно по вашей вине.", "2020-06-10T17:25:57.391673295Z", "colorless", "0", 1, 1, 1, "Канистра 10л горизонтальная металлическая", "STVOL"], "30": ["пришел не комплект нет шланга.", "2019-12-12T23:10:01.461178254Z", "colorless", "0", 1, 0, 5, "Канистра 10л горизонтальная металлическая", "STVOL"], "31": ["Мне очень понравилась,красивая,с дудулькой,шов в резинке,крышечка очень плотно закрывается,езжу с ней около 2 недель в багажнике, она полная,запаха бензина нет.", "2019-12-04T08:41:10.543259909Z", "colorless", "0", 2, 0, 5, "Канистра 10л горизонтальная металлическая", "STVOL"], "32": ["Сама канистра не плохая, но пришел некомплект, шланг отсутствовал(. В итоге отказ от товара", "2019-11-28T21:24:55.806603441Z", "colorless", "0", 2, 1, 2, "Канистра 10л горизонтальная металлическая", "STVOL"], "34": ["Начну с плюсов: аккуратная, компактная, пришла в полной комплектации, ржавчины нет.\nТеперь о минусах: отверстие в корпусе (на фото болт возле ручки) явно лишнее. Не герметичное, при тряске в машине бензин протекает, прокладка мягкая и при закручивании болт её просто выталкивает.\nИсправлю конечно, но впечатление испортилось.", "2019-11-10T07:05:26.213512034Z", "colorless", "0", 2, 0, 3, "Канистра 10л горизонтальная металлическая", "STVOL"], "35": ["Пришел товар без сливной трубки. Упаковка из целлофана была повреждена. За возврат товара осталась еще должна.", "2019-10-20T15:29:09.117623829Z", "зеленый", "0", 1, 1, 2, "Канистра 10л горизонтальная металлическая", "STVOL"], "36": ["Канистра пришла без сливного шланга, сдела возврат в пункте выдачи. Прошу не вычитывать процент выкупа всвязи с неполной комплектацией. Делаю перезаказ прошу будьте внимательны к отправке заказа.", "2019-09-14T16:30:09.406996859Z", "зеленый", "0", 2, 0, 5, "Канистра 10л горизонтальная металлическая", "STVOL"], "38": ["Внутри под резинкой на крышке есть мелкая ржавчинка. Это не критично, а так супер. Буду проверять на протекание.", "2019-07-31T17:32:30.405004689Z", "зеленый", "0", 1, 0, 5, "Канистра 10л горизонтальная металлическая", "STVOL"], "39": ["Фото говорит само за себя (((( и отсутствует сливной шланг", "2019-06-27T17:25:15.508083588Z", "зеленый", "0", 2, 1, 1, "Канистра 10л горизонтальная металлическая", "STVOL"], "40": ["Канистра пришла без заливной трубки, кто-то видать себе как запаску взял. Оформили как некомлект поставки. А так канистра вроде ничего", "2019-05-26T18:10:38.065706063Z", "зеленый", "0", 2, 0, 5, "Канистра 10л горизонтальная металлическая", "STVOL"], "41": ["Не довольна товаром. Хотя размер понравился.\n1. канистра пришла без сливного шланга.( не заметила при получении канистры. Внимание обратила только при открывании фото на сайте) \n2. отвалилась крышка от канистры и она вся ржавая... жуть. и это при том что я ее всего 2 раза открыла. при курьере было норм, а во второй раз посыпалась ржавчина и крышка развалилась на 2 части.\n3. Канистра пахнет бензином. Несильно но пахнет.\nСоздала заявку на возврат.", "2019-05-22T09:51:10.900312446Z", "зеленый", "0", 2, 0, 1, "Канистра 10л горизонтальная металлическая", "STVOL"], "42": ["Канистра превзошла все ожидания, просто супер! Во первых устойчивая, и во вторых, что самое главное, очень компактная, по виду даже и не подумаешь, что она 10 литровая, но тем не менее это так. Рекомендую присмотреться к данному товару.", "2019-03-04T15:19:18.55371193Z", "зеленый", "0", 2, 1, 5, "Канистра 10л горизонтальная металлическая", "STVOL"]}
